Review:
Works OK, but note:
1) only 1 DC Fast charger (both CHAdeMO & CCS plugs) & 2 Level 2 J-1772 units, so DC FC not always available when you need it;
2) never seem to get more than ~35A vice full 50A from CHAdeMO DC FC; 3) both are expensive & price is by time vice kWHr (& DC FC is ~4x price of L2 when I compared what I got out of each on our LEAF); & area can be a little concerning to charge at after dark due to homeless & other people hanging around or passing by.
